					<rect x="298.446" y="443.514" fill="none" width="1178.644" height="291.127"/>
					<text transform="matrix(0.9998 0 0 1 298.447 459.8416)" fill="#444444" font-family="'Karla-Bold'" font-size="23.8">Google Spain v AEPD and Mario Costeja González</text>
					<text transform="matrix(0.9998 0 0 1 298.447 508.8015)" fill="#444444" font-family="'Karla-Regular'" font-size="17">In </text>
					<text transform="matrix(0.9998 0 0 1 317.5007 508.8015)" fill="#444444" font-family="'Karla-Bold'" font-size="17">1998</text>
					<text transform="matrix(0.9998 0 0 1 355.2996 508.8015)" fill="#444444" font-family="'Karla-Regular'" font-size="17"> the Spanish newspaper La Vanguardia published two announcements in its printed edition regarding Mario Costeja González&apos;s debts.</text>
					<text transform="matrix(0.9998 0 0 1 298.447 529.2019)" fill="#444444" font-family="'Karla-Regular'" font-size="17">In </text>
					<text transform="matrix(0.9998 0 0 1 317.5007 529.2019)" fill="#444444" font-family="'Karla-Bold'" font-size="17">November 2009</text>
					<text transform="matrix(0.9998 0 0 1 446.2468 529.2019)" fill="#444444" font-family="'Karla-Regular'" font-size="17">, Costeja contacted the newspaper to complain that when his name was entered in the Google search engine it led to the </text>
					<text transform="matrix(0.9998 0 0 1 298.447 549.6013)" fill="#444444" font-family="'Karla-Regular'" font-size="17">announcements. He asked that the data relating to him be removed, arguing that they were no longer relevant. The newspaper refused, so González </text>
					<text transform="matrix(0.9998 0 0 1 298.447 570.0017)" fill="#444444" font-family="'Karla-Regular'" font-size="17">contacted Google Spain in </text>
					<text transform="matrix(0.9998 0 0 1 506.0066 570.0017)" fill="#444444" font-family="'Karla-Bold'" font-size="17">February 2010</text>
					<text transform="matrix(0.9998 0 0 1 620.2058 570.0017)" fill="#444444" font-family="'Karla-Regular'" font-size="17">, asking to remove the links.</text>
					<text transform="matrix(0.9998 0 0 1 298.447 590.4011)" fill="#444444" font-family="'Karla-Regular'" font-size="17">Costeja subsequently lodged a complaint with the Spanish Data Protection Agency (AEPD) asking both that the newspaper be required to remove the </text>
					<text transform="matrix(0.9998 0 0 1 298.447 610.8015)" fill="#444444" font-family="'Karla-Regular'" font-size="17">data and that Google Spain or Google Inc. be required to remove the links to the data.</text>
					<text transform="matrix(0.9998 0 0 1 298.447 631.2019)" fill="#444444" font-family="'Karla-Regular'" font-size="17">On 30 </text>
					<text transform="matrix(0.9998 0 0 1 347.906 631.2019)" fill="#444444" font-family="'Karla-Bold'" font-size="17">July 2010</text>
					<text transform="matrix(0.9998 0 0 1 422.0105 631.2019)" fill="#444444" font-family="'Karla-Regular'" font-size="17">, the Director of APED rejected the complaint against the newspaper but upheld the complaint against Google Spain and Google Inc.</text>
					<text transform="matrix(0.9998 0 0 1 298.447 651.6013)" fill="#444444" font-family="'Karla-Regular'" font-size="17">Google Spain and Google Inc. subsequently brought separate actions against the decision before the Audiencia Nacional (National High Court of Spain).</text>
					<text transform="matrix(0.9998 0 0 1 298.447 672.0017)" fill="#444444" font-family="'Karla-Regular'" font-size="17">The Audiencia Nacional joined the actions and stayed the proceedings pending a preliminary ruling from the CJEU on a number of questions regarding </text>
					<text transform="matrix(0.9998 0 0 1 298.447 692.4011)" fill="#444444" font-family="'Karla-Regular'" font-size="17">the interpretation of the Data Protection Directive.</text>
					<text transform="matrix(0.9998 0 0 1 298.447 712.8005)" fill="#444444" font-family="'Karla-Regular'" font-size="17">In </text>
					<text transform="matrix(0.9998 0 0 1 317.5007 712.8005)" fill="#444444" font-family="'Karla-Bold'" font-size="17">May 2014</text>
					<text transform="matrix(0.9998 0 0 1 392.3699 712.8005)" fill="#444444" font-family="'Karla-Regular'" font-size="17"> the Court of Justice of the European Union ruled that an internet search engine operator is responsible for the processing that it carries </text>
					<text transform="matrix(0.9998 0 0 1 298.447 733.2019)" fill="#444444" font-family="'Karla-Regular'" font-size="17">out of personal data which appear on web pages published by third parties, upholding a right of erasure.</text>
